m=d.jS("5. Uso Apropiado","Te comprometes a:\n\n\u2022 Utilizar la aplicaci\xf3n solo para fines legales y apropiados\n\u2022 No intentar acceder sin autorizaci\xf3n a otras cuentas\n\u2022 No cargar contenido ofensivo, ilegal o inapropiado\n\u2022 No interferir con el funcionamiento normal de la aplicaci\xf3n\n\u2022 No usar la aplicaci\xf3n para spam o actividades maliciosas")
l=d.jS("6. Contenido del Usuario","Conservas todos los derechos sobre el contenido que subas a BabyCare (fotos, notas, registros). Sin embargo, nos otorgas una licencia limitada para almacenar y procesar este contenido con el fin de proporcionar el servicio.\n\nPuedes eliminar tu contenido en cualquier momento desde la configuraci\xf3n de la aplicaci\xf3n.")
k=d.jS("7. Limitaci\xf3n de Responsabilidad","BabyCare es una herramienta de registro y organizaci\xf3n. NO proporciona asesoramiento m\xe9dico profesional.\n\nImportante:\n\u2022 No sustituimos la opini\xf3n de profesionales de la salud\n\u2022 Las decisiones m\xe9dicas deben consultarse con un pediatra\n\u2022 No somos responsables por decisiones tomadas basadas \xfanicamente en la informaci\xf3n de la app\n\u2022 En caso de emergencia m\xe9dica, contacta inmediatamente con servicios de salud")
j=d.jS("8. Modificaciones del Servicio","Nos reservamos el derecho de:\n\n\u2022 Modificar o discontinuar caracter\xedsticas de la aplicaci\xf3n\n\u2022 Actualizar estos t\xe9rminos y condiciones\n\u2022 Cambiar los planes de precios (si aplica)\n\nTe notificaremos sobre cambios significativos con antelaci\xf3n razonable.")
i=d.jS("9. Terminaci\xf3n de Cuenta","Puedes cancelar tu cuenta en cualquier momento desde la configuraci\xf3n de la aplicaci\xf3n.\n\nNos reservamos el derecho de suspender o terminar cuentas que:\n\u2022 Violen estos t\xe9rminos y condiciones\n\u2022 Participen en actividades fraudulentas\n\u2022 Abusen del servicio de manera que perjudique a otros usuarios")
h=d.jS("10. Propiedad Intelectual","Todo el contenido, caracter\xedsticas y funcionalidad de BabyCare (incluyendo pero no limitado a dise\xf1o, texto, gr\xe1ficos, logos) son propiedad exclusiva de BabyCare y est\xe1n protegidos por leyes de derechos de autor y propiedad intelectual.")
g=d.jS("11. Contacto","Para preguntas sobre estos t\xe9rminos y condiciones, puedes contactarnos a trav\xe9s de:\n\nEmail: babycaretfg@gmail.com\nNos esforzamos por responder a todas las consultas en un plazo de 48 horas.")
